import React from 'react';

const MovieList = (props) => {
	return (
		<>
			{props.movies.map((movie, index) => (
				<div className='image-container d-flex justify-content-start m-3' style={{border: '1px solid black'}}>
					<img src={movie.Poster} alt={movie.Title} style={{marginBottom: '2rem'}}></img>
					<div style={{display: 'flex', justifyContent: 'space-evenly', alignItems: 'center'}}>
						<h2>{movie.Title}</h2>
						<h2>{movie.Year}</h2>
					</div>
				</div>
			))}
		</>
	);
};

export default MovieList;
